import React from "react";
import { NavLink } from "react-router-dom";


export default function Movies(parameter) {
    return (
        <>
            {parameter.movies.map((movies) => (
                <div className="movieabout">
                    <img src={movies.Poster_Link} alt="movies_img" />
                    <NavLink className="actualmovies" to={"/movies/" + movies.id}>
                        <h3 className="title">{movies.Series_Title}</h3>
                    </NavLink>
                    <p className="overview">{movies.Overview}</p>
                    <h5 className="genre">{movies.Genre}</h5>
                    <h5 className="runtime">{movies.Runtime}</h5>
                </div>
            ))}
        </>
    );
}
